import React from 'react';
import TaskItem from './TaskItem';
const TaskList = ({ tasks, onDeleteTask, onUpdateTask }) => {
  return (
    <div>
      {tasks.map(task => (
        <TaskItem 
          key={task.id} 
          task={task} 
          onDeleteTask={onDeleteTask}
          onUpdateTask={onUpdateTask}
        />
      ))}
    </div>
  );
};
export default TaskList;
